        useForLater[apiUseTime] = storeTable;
        
        for i, v in next, useForLater[apiUseTime-1] do
            local superClass = explorer.classes[v.Superclass];
            local classTable;
            if v.Superclass == "<<<ROOT>>>" then
				superClass = {};
			end;
            if superClass == nil then
                tableInsert(storeTable, v);
                continue;
            end;
            classTable = tableClone(superClass)

            for n, q in next, v.Members do
                local tags = q.Tags;
                if q.MemberType ~= "Property" or tags and (tableFind(tags, "Hidden") or tableFind(tags, "NotScriptable")) or v.Security == "PluginSecurity" or v.Category == "Permissions" then
                    continue;
                end;
                classTable[q.Name] = {q.ValueType.Name};
                if tags and tableFind(tags, "ReadOnly") then
                    tableInsert(classTable[q.Name], "readonly");
                end;
            end;
            explorer.classes[v.Name] = classTable;
        end;
        if #storeTable == 0 then
			break;
		end;
	end;

    function explorer.getPath(target: Instance)
        local path = {target};
        local current = target;
        while current ~= game do
			if current == nil then
				tableInsert(path, nilInstances);
				break;
			end;
            current = current.Parent;
            tableInsert(path, current);
        end;
        return path;
    end;

    function explorer.isValidName(name: string)
        return stringGsub(stringGsub(stringLower(name), "%a", ""), "%d", "") == "" and stringFind(name, "%d") ~= 1;
    end;

    function explorer.getStringPath(target: Instance)
        local path = explorer.getPath(target);
        local pathString = "not implemented yet!";

        if path[#path] == game then
			pathString = `game:GetService(\"{path[#path-1].ClassName}\").`;
            for i = -#path+2, -1 do
                local name = path[-i].Name;
                if not explorer.isValidName(name) then
                    pathString = stringSub(pathString, 1, -2) .. `["{name}"].`;
                else
                    pathString ..= name .. ".";
                end;
            end;
            pathString = stringSub(pathString, -1, -1) == "." and stringSub(pathString, 1, -2) or pathString;
		end;
        return pathString
    end;

    function explorer.addInstance(object, parent, shouldSet)
        parent = parent or explorer.instances;
        if parent[object] then
			return;
		end;
        currentIndexItems += 1;
        local publicTable = {name = object.Name, open = false, class = object.ClassName, index = tostring(currentIndexItems), instances = {}, parent = parent.pointer};
        publicTable.instances.pointer = publicTable;
        explorer.rawInstances[object] = publicTable;

        if object.Parent == nil then
			parent = explorer.instances[nilInstances].instances;
            publicTable.parent = parent;
			parent[object] = publicTable;
        elseif object.Parent ~= game and not shouldSet then
            local path = explorer.getPath(object);

            local lastTable = path[#path] == game and explorer.instances or explorer.instances[nilInstances].instances;
            for i = -#path+1, -1 do
				local instance = path[-i];
				local newPublicTable = lastTable[instance];
                if not newPublicTable then	
					explorer.addInstance(instance, lastTable, true);
                    newPublicTable = lastTable[instance];
				end;
				lastTable = newPublicTable.instances;
			end;

        else  
            parent[object] = publicTable;
		end;
    end;

    function explorer.draw(object, parent, indent)
        indent = indent or 0;
        parent = parent or explorer.instances;

        local publicTable = parent[object];
        parent = publicTable.instances;
        ImGui.Text(""); ImGui.SameLine(20*indent);
        local clicked = ImGui.ArrowButton(publicTable.name.."arrowbtn##"..publicTable.index, publicTable.open and 3 or 1); ImGui.SameLine();
        ImGui.Image(explorer.icons[publicTable.class] or explorer.icons.Default, vector2New(16, 16)); ImGui.SameLine();
        local drawn, clicked2 = ImGui.Selectable(publicTable.name.."##"..publicTable.index, false);
        if clicked then
			publicTable.open = not publicTable.open;
		end;
        if clicked2 and object ~= nilInstances then
			explorer.selected = object;
            taskDefer(tableClear, explorer.properties);
            taskDefer(tableClear, explorer.types);
            taskDefer(tableClear, explorer.indexes);
            taskDefer(tableClear, explorer.flags);
            taskDefer(tableClear, explorer.realValues);

            taskDefer(tableInsert, explorer.indexes, "Name");
            taskDefer(tableInsert, explorer.indexes, "ClassName");
            taskDefer(tableInsert, explorer.indexes, "Parent");
		end;
        if (publicTable.open) then
			for i, v in next, parent do
				if i == "pointer" then
					continue;
				end;
                explorer.draw(i, parent, indent + 1);
			end;
		end;
    end;

    function explorer.fixFloatingPoint(chance: number) -- https://devforum.roblox.com/t/help-with-floating-point-errors/2474289/3
        return stringGsub(stringFormat("%.3f", chance), "%.?0+$", "")
    end;

    function explorer.teleportTo(part: BasePart)
        local character = localPlayer.Character;
        if not character then
			return;
		end;
        local rootPart = character:FindFirstChild("HumanoidRootPart") or character.PrimaryPart;
        if not rootPart then
			return;
		end;
        rootPart.CFrame = part.CFrame;
    end;

    -- start property loop

   taskSpawn(function()
	   
		while taskWait(explorer.updateRate) do
			local instance = explorer.selected;
            local class = instance and explorer.classes[instance.ClassName];
			if not class then
				continue;
			end;

            local indexes, properties, flags, types, realValues = explorer.indexes, explorer.properties, explorer.flags, explorer.types, explorer.realValues;
            local n = 3;
            for i, v in next, class do
				if i ~= "Name" and i ~= "ClassName" and i ~= "Parent" then
					n += 1;
                    indexes[n] = i;
				end;

                local valueType = v[1];

                if valueType == "float" then
					properties[i] = explorer.fixFloatingPoint(instance[i]);
                else
					pcall(function()
                        properties[i] = tostring(instance[i]);
                        realValues[i] = instance[i];
                    end) -- idk what the fuck?
				end;

                types[i] = valueType;
                flags[i] = v[2];
			end;
		end;
	end);

end;

