for i, v in next, game:GetDescendants() do
	explorer.addInstance((v));
    local signal = v:GetPropertyChangedSignal("Name");
    if not signal then
		continue;
	end;
    local con; con = signal:Connect(function()
		if v == nil then
			con:Disconnect();
            return;
		end;
        explorer.rawInstances[v].name = v.Name;
	end);
end;
for i, v in next, getnilinstances() do
	
    if v == nil then
		continue;
	end;
	explorer.addInstance((v));
    local signal = v:GetPropertyChangedSignal("Name");
    if not signal then
		continue;
	end;
    local con; con = signal:Connect(function()
		if v == nil then
			con:Disconnect();
            return;
		end;
        explorer.rawInstances[v].name = v.Name;
	end);
end;

game.DescendantAdded:Connect(function(object)
	explorer.addInstance(object);
end);
game.DescendantRemoving:Connect(function(object)
    if object == nil then
		return;
	end;
    local data = explorer.rawInstances[object];
    if not data or not data.parent or not data.parent.instances then
		return;
	end;
    data.parent.instances[object] = nil;
    tableClear(data);
    if explorer.selected == object then
		explorer.selected = nil;
	end;
end);

