						ImGui.Text(`{i}:`); ImGui.SameLine();
                        local value = ImGui.Checkbox(v..`##{i}`, realValue); ImGui.SameLine();
                        if value ~= realValue then
                            taskDefer(sethiddenproperty, explorer.selected, i, value);
                        end;
